const API_ROOT = "https://reqres.in/api";

export const API_URLS = {
  login: () => `${API_ROOT}/login`,
  signup: () => `${API_ROOT}/register`,
  posts: (page) => `${API_ROOT}/users?page=${page}`,
};

export const LOCALSTORAGE_TOKEN_KEY = "__codeial_token__";
